import React from 'react';
import Home from "./Home"
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { AuthProvider } from "./components/Auth";


function App() {

  return (
   <AuthProvider>
      <Router>
        <Switch>
          <Route exact path="/" component={Home} />
        </Switch>
      </Router>
    </AuthProvider>    
  );
}

export default App;
